import React from 'react';
import { Route, Routes } from 'react-router-dom';
import UserPosts from '../pages/User/posts';
import UserFavourite from '../pages/User/favorite';
import UserPhotos from '../pages/User/photos';
import UserLayout from '../layouts/UserLayout';

const UserRoutes = () => {
    return (<>
        <UserLayout />
        <Routes>
            <Route index Component={UserPosts}/>
            <Route path="posts" Component={UserPosts} />
            <Route path="favourites" Component={UserFavourite} />
            <Route path="photos" Component={UserPhotos} />
        </Routes>
    </>);
};

export default UserRoutes;
